	For[i=1,i<Length[LV],i++,
		For[j=i+1,j<Length[LV]+1,j++,
			IfTemp=Mat1[[1;;i,j]]//DeleteDuplicates//DeleteCases[#,0,Infinity]&; (*Removes cases when the numerical factor is 0 or infinity*)
			If[Length[IfTemp]==1&&Mat1[[i,j]]!=0,
